import React, { Component } from 'react';
import './SortController.css'

class SortController extends Component{
    render(){
        return(<div className = "nav">
                    <button className = "reset" onClick = {this.props.clicked}>Reset Array</button>
                    <div >
                        <button className = "nav-item" onClick = {this.props.BubbleSortclicked}>Buble Sort</button>
                        <button className = "nav-item" onClick = {this.props.InsertonSortclicked}>Insertion Sort</button>
                        <button className = "nav-item"onClick = {this.props.SelectionSortclicked}>Selection Sort</button>
                        <button className = "nav-item"onClick = {this.props.InsertionSortAnimation}>Merge Sort</button>
                        <button className = "nav-item"onClick = {this.props.InsertionSortAnimation}>Quick Sort</button>

            </div>
        </div>

        )
    }
}

export default SortController;
